import React from 'react';
import './style.css'

const AddPlaylistBox = ({status, handleChange}) => {
    return (
        <div>
            <input type="text" className={`${status}`} onChange={(e) => handleChange(e)}/>
        </div>
    );
};

export default AddPlaylistBox;
